import styled from "styled-components";

export const MainDash = styled.main`
height: 100%;
display: grid;
display: grid;
grid-template-columns: 1fr;
grid-template-rows: repeat(2, 1fr) 8fr;
grid-column-gap: 0px;
grid-row-gap: 0px;
color: #000;
font-size: 3rem;
`

export const NavbarArea = styled.div`
grid-area: 1 / 1 / 2 / 2;
background: green;
`

export const SearchBarArea = styled.div`
grid-area: 2 / 1 / 3 / 2;
background: red;
`

export const ContentArea = styled.div`
grid-area: 3 / 1 / 4 / 2;
height: 70%;
background: yellow;
`
